import PropTypes from 'prop-types';
import React from "react";
import { Link } from "react-router-dom";
import {Nav, NavDropdown, Navbar} from "react-bootstrap";

function HeaderNavbar() {

  return (
    <Navbar id="navbar-bg" collapseOnSelect expand="lg" variant="dark">
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="row navbar-center">
          <div className="col">
            <Nav.Link eventKey={1} href="/home">Startseite</Nav.Link>
          </div>
          <div className="col">
            <Nav.Link eventKey={2} as={Link} to="/services">Leistungen</Nav.Link>
            <NavDropdown id="collasible-nav-dropdown">
              <NavDropdown.Item eventKey={2.1} as={Link} to="/leistung1">Leistung1</NavDropdown.Item>
              <NavDropdown.Item eventKey={2.2} as={Link} to="/leistung2">Leistung2</NavDropdown.Item>
              <NavDropdown.Item eventKey={2.3} as={Link} to="/leistung3">Leistung3</NavDropdown.Item>
            </NavDropdown>
          </div>
          <div className="col">
            <Nav.Link eventKey={3} as={Link} to="/aboutMe">Ãœber mich</Nav.Link>
          </div>
          <div className="col">
            <Nav.Link eventKey={4} as={Link} to="/contact">Kontakt</Nav.Link>
          </div>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default HeaderNavbar;
